window.bookSummaryJSON = "<p><b>The road to hell is paved with good intentions.</b></p> <p>She gave, we took, then I demanded more.</p> <p>I had my reasons, but none of them are good enough to validate what happened.</p> <p>I need her to forgive me, but I don’t know if I went too far this time.</p> <p><b>Going through the motions.</b></p> <p>Starting over in a new state, at a new school, is easy compared to losing something I never really had in the first place, but I’ve gotten good at faking it.</p> <p>Too bad I feel like this time pretending I’m okay might actually break me.</p> <p><b><i>Touching Oblivion is the second book of the Tasting Madness Series. This is Reverse Harem novel with adult themes and situations told in dual POV.</i></b></p>"; 
